import axios from 'axios';

const url = 'https://covid19.mathdro.id/api';

export const fetchData = async () => {
    try {
        const {data:{ confrimed, recovered, deaths, lastUpdated}} = await axios.get(url);

        return { confrimed, recovered, deaths, lastUpdated};
    } catch(error) {

    }
}
